import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";

function Table() {
  return (
    <tr>
      <th>Type</th>
      <th>Name</th>
      <th>Date</th>
      <th>Amount</th>
    </tr>
  );
}

export default Table;
